            }
            
            .node {

                stroke-width: 1.5px;
            }
            
            .link {

                stroke-opacity: 0.6;

                pointer-events: none;

            .link-label {
                font-size: 10px;
                pointer-events: none;

            #controls {
                position: absolute;
                top: 10px;
                left: 10px;
                background-color: rgba(255, 255, 255, 0.8);
                padding: 10px;
                border-radius: 5px;
                box-shadow: 0 0 5px rgba(0, 0, 0, 0.2);
            }
            
            #search-box {
                position: absolute;
                top: 10px;
                right: 10px;
                background-color: rgba(255, 255, 255, 0.8);
                padding: 10px;
                border-radius: 5px;
                box-shadow: 0 0 5px rgba(0, 0, 0, 0.2);
            }
            
            .info-box {
                position: absolute;
                bottom: 10px;
                left: 10px;
                background-color: rgba(255, 255, 255, 0.8);
                padding: 10px;
                border-radius: 5px;
                box-shadow: 0 0 5px rgba(0, 0, 0, 0.2);
                max-width: 400px;
                max-height: 300px;
                overflow: auto;
                font-size: 12px;
            }
            
            #legend {
                position: absolute;
                bottom: 10px;
                right: 10px;
                background-color: rgba(255, 255, 255, 0.8);
                padding: 10px;
                border-radius: 5px;
                box-shadow: 0 0 5px rgba(0, 0, 0, 0.2);
            }
            
            .color-dot {
                display: inline-block;
                width: 10px;
                height: 10px;
                border-radius: 50%;
                margin-right: 5px;
            }
            
            .search-result {
                cursor: pointer;
                padding: 3px;
                margin: 2px 0;
            }
            
            .search-result:hover {
                background-color: #eee;
            }
            
            .relationship-toggle {

            <div>

            <div>
                <input type="checkbox" id="show-function" checked>

            <div>

            <div class="relationship-toggle">

-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7023", "label": "DEFINES"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7023", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7024", "label": "DEFINES"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7024", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7025", "label": "DEFINES"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7025", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7026", "label": "DEFINES"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7026", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7027", "label": "DEFINES"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7027", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7028", "label": "DEFINES"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7028", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7029", "label": "DEFINES"}, {"source": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:7029", "target": "4:9d745a79-5d80-468a-a3f9-3d8bc976b4df:26268", "label": "PART_OF"}];
            
            // Color scheme for node types
            const colorMap = {
                File: "#fc8d62",
                Function: "#8da0cb",
                Class: "#e78ac3",
                Method: "#a6d854",
                CodeSummary: "#ffd92f",
                Unknown: "#999999"
            };
            
            // Node size by type
            const sizeMap = {
                File: 8,
                Function: 5,
                Class: 7,
                Method: 5,
                CodeSummary: 9,
                Unknown: 5
            };
            
            // Set up the SVG
            const width = window.innerWidth;
            const height = window.innerHeight;
            
            const svg = d3.select("#graph-container")
                .append("svg")
                .attr("width", width)
                .attr("height", height);
            
            // Container for all graph elements (for zooming)
            const container = svg.append("g");
            
            // Create the simulation
            const simulation = d3.forceSimulation()
                .force("link", d3.forceLink().id(d => d.id).distance(d => {
                    // Adjust distance based on node types
                    const sourceType = d.source.type || "Unknown";
                    const targetType = d.target.type || "Unknown";
                    
                    if (sourceType === "CodeSummary" || targetType === "CodeSummary") {
                        return 100; // Summaries closer to their nodes
                    } else {
                        return 70; // Default distance
                    }
                }))
                .force("charge", d3.forceManyBody().strength(-200))
                .force("center", d3.forceCenter(width / 2, height / 2))
                .force("collision", d3.forceCollide().radius(d => getNodeSize(d) * 2));
            
            // Helper function to get node size
            function getNodeSize(d) {
                return sizeMap[d.type] || 5;
            }
            
            // Create links
            const link = container.append("g")
                .selectAll("line")
                .data(linksData)
                .enter()
                .append("line")
                .attr("class", "link")
                .attr("stroke-width", 1);
            
            // Create link labels (only visible on hover)
            const linkLabel = container.append("g")
                .selectAll("text")
                .data(linksData)
                .enter()
                .append("text")
                .attr("class", "link-label")
                .attr("opacity", 0)  // Initially hidden
                .text(d => d.label);
            
            // Create nodes
            const node = container.append("g")
                .selectAll("circle")
                .data(nodesData)
                .enter()
                .append("circle")
                .attr("class", "node")
                .attr("r", getNodeSize)
                .attr("fill", d => colorMap[d.type] || "#999")
                .call(d3.drag()
                    .on("start", dragstarted)
                    .on("drag", dragged)
                    .on("end", dragended))
                .on("click", showNodeInfo)
                .on("mouseover", handleMouseOver)
                .on("mouseout", handleMouseOut);
            
            // Create node labels (only visible when zoomed in)
            const nodeLabel = container.append("g")
                .selectAll("text")
                .data(nodesData)
                .enter()
                .append("text")
                .attr("class", "node-label")
                .attr("dy", "-10")
                .text(d => d.label || "")
                .attr("opacity", 0);  // Initially hidden
            
            // Set up simulation
            simulation
                .nodes(nodesData)
                .on("tick", ticked);
            
            simulation.force("link")
                .links(linksData);
            
            // Function to update positions on tick
            function ticked() {
                link
                    .attr("x1", d => d.source.x)
                    .attr("y1", d => d.source.y)
                    .attr("x2", d => d.target.x)
                    .attr("y2", d => d.target.y);
                
                linkLabel
                    .attr("x", d => (d.source.x + d.target.x) / 2)
                    .attr("y", d => (d.source.y + d.target.y) / 2);
                
                node
                    .attr("cx", d => d.x = Math.max(getNodeSize(d), Math.min(width - getNodeSize(d), d.x)))
                    .attr("cy", d => d.y = Math.max(getNodeSize(d), Math.min(height - getNodeSize(d), d.y)));
                
                nodeLabel
                    .attr("x", d => d.x)
                    .attr("y", d => d.y);
            }
            
            // Handle mouseover to highlight connections
            function handleMouseOver(event, d) {
                // Highlight the node
                d3.select(this).attr("stroke", "#000").attr("stroke-width", 2);
                
                // Find connected links and nodes
                const connectedLinks = linksData.filter(l => 
                    (l.source.id === d.id || l.source === d.id) || 
                    (l.target.id === d.id || l.target === d.id)
                );
                
                const connectedNodeIds = new Set();
                
                connectedLinks.forEach(l => {
                    // Get source and target IDs
                    const sourceId = typeof l.source === 'object' ? l.source.id : l.source;
                    const targetId = typeof l.target === 'object' ? l.target.id : l.target;
                    
                    // Add connected node IDs
                    if (sourceId === d.id) {
                        connectedNodeIds.add(targetId);
                    } else {
                        connectedNodeIds.add(sourceId);
                    }
                    
                    // Highlight link
                    link.filter(link => link === l)
                        .attr("stroke", "#000")
                        .attr("stroke-width", 2);
                    
                    // Show link label
                    linkLabel.filter(link => link === l)
                        .attr("opacity", 1);
                });
                
                // Highlight connected nodes
                node.filter(n => connectedNodeIds.has(n.id))
                    .attr("stroke", "#000")
                    .attr("stroke-width", 2);
                
                // Show labels for this node and connected nodes
                nodeLabel.filter(n => n.id === d.id || connectedNodeIds.has(n.id))
                    .attr("opacity", 1);
            }
            
            // Handle mouseout to reset highlights
            function handleMouseOut() {
                node.attr("stroke", "#fff").attr("stroke-width", 1.5);
                link.attr("stroke", "#999").attr("stroke-width", 1);
                linkLabel.attr("opacity", 0);
                
                // Only show labels when zoomed in
                const currentZoom = d3.zoomTransform(svg.node()).k;
                nodeLabel.attr("opacity", currentZoom > 1.5 ? 0.8 : 0);
            }
            
            // Drag functions
            function dragstarted(event, d) {
                if (!event.active) simulation.alphaTarget(0.3).restart();
                d.fx = d.x;
                d.fy = d.y;
            }
            
            function dragged(event, d) {
                d.fx = event.x;
                d.fy = event.y;
            }
            
            function dragended(event, d) {
                if (!event.active) simulation.alphaTarget(0);
                d.fx = null;
                d.fy = null;
            }
            
            // Show node info when clicked
            function showNodeInfo(event, d) {
                const infoBox = document.getElementById("node-info");
                const infoContent = document.getElementById("info-content");
                
                infoBox.style.display = "block";
                
                let html = `<p><strong>ID:</strong> ${d.id}</p>`;
                html += `<p><strong>Type:</strong> ${d.type}</p>`;
                html += `<p><strong>Label:</strong> ${d.label}</p>`;
                
                if (d.properties) {
                    html += "<p><strong>Properties:</strong></p><ul>";
                    for (const [key, value] of Object.entries(d.properties)) {
                        if (value !== null && value !== undefined) {
                            if (key === "summary") {
                                // Format summary text for better readability
                                html += `<li>${key}: <pre style="white-space: pre-wrap; font-size: 12px; background-color: #f0f0f0; padding: 8px; border-radius: 4px;">${value}</pre></li>`;
                            } else {
                                html += `<li>${key}: ${value}</li>`;
                            }
                        }
                    }
                    html += "</ul>";
                }
                
                // Show connected nodes
                const connectedLinks = linksData.filter(l => 
                    (l.source.id === d.id || l.source === d.id) || 
                    (l.target.id === d.id || l.target === d.id)
                );
                
                if (connectedLinks.length > 0) {
                    html += "<p><strong>Connections:</strong></p><ul>";
                    
                    connectedLinks.forEach(l => {
                        const sourceId = typeof l.source === 'object' ? l.source.id : l.source;
                        const targetId = typeof l.target === 'object' ? l.target.id : l.target;
                        
                        const otherNodeId = sourceId === d.id ? targetId : sourceId;
                        const otherNode = nodesData.find(n => n.id === otherNodeId);
                        
                        if (otherNode) {
                            const direction = sourceId === d.id ? "" : "";
                            html += `<li>${direction} ${l.label} ${otherNode.type}: ${otherNode.label}</li>`;
                        }
                    });
                    
                    html += "</ul>";
                }
                
                infoContent.innerHTML = html;
            }
            
            // Set up filtering
            document.getElementById("show-file").addEventListener("change", filterGraph);
            document.getElementById("show-function").addEventListener("change", filterGraph);
            document.getElementById("show-class").addEventListener("change", filterGraph);
            document.getElementById("show-method").addEventListener("change", filterGraph);
            document.getElementById("show-summary").addEventListener("change", filterGraph);
            
            document.getElementById("show-defines").addEventListener("change", filterGraph);
            document.getElementById("show-part-of").addEventListener("change", filterGraph);
            document.getElementById("show-describes").addEventListener("change", filterGraph);
            
            function filterGraph() {
                const showFile = document.getElementById("show-file").checked;
                const showFunction = document.getElementById("show-function").checked;
                const showClass = document.getElementById("show-class").checked;
                const showMethod = document.getElementById("show-method").checked;
                const showSummary = document.getElementById("show-summary").checked;
                
                const showDefines = document.getElementById("show-defines").checked;
                const showPartOf = document.getElementById("show-part-of").checked;
                const showDescribes = document.getElementById("show-describes").checked;
                
                // Filter nodes
                node.style("display", d => {
                    if (d.type === "File" && !showFile) return "none";
                    if (d.type === "Function" && !showFunction) return "none";
                    if (d.type === "Class" && !showClass) return "none";
                    if (d.type === "Method" && !showMethod) return "none";
                    if (d.type === "CodeSummary" && !showSummary) return "none";
                    return null;
                });
                
                // Filter node labels
                nodeLabel.style("display", d => {
                    if (d.type === "File" && !showFile) return "none";
                    if (d.type === "Function" && !showFunction) return "none";
                    if (d.type === "Class" && !showClass) return "none";
                    if (d.type === "Method" && !showMethod) return "none";
                    if (d.type === "CodeSummary" && !showSummary) return "none";
                    return null;
                });
                
                // Filter links based on relationship types and visible nodes
                link.style("display", d => {
                    // Filter by relationship type
                    if (d.label === "DEFINES" && !showDefines) return "none";
                    if (d.label === "PART_OF" && !showPartOf) return "none";
                    if ((d.label === "DESCRIBES" || d.label === "SUMMARIZES") && !showDescribes) return "none";
                    
                    // Filter by node visibility
                    const sourceType = d.source.type;
                    const targetType = d.target.type;
                    
                    const sourceVisible = (
                        (sourceType === "File" && showFile) ||
                        (sourceType === "Function" && showFunction) ||
                        (sourceType === "Class" && showClass) ||
                        (sourceType === "Method" && showMethod) ||
                        (sourceType === "CodeSummary" && showSummary)
                    );
                    
                    const targetVisible = (
                        (targetType === "File" && showFile) ||
                        (targetType === "Function" && showFunction) ||
                        (targetType === "Class" && showClass) ||
                        (targetType === "Method" && showMethod) ||
                        (targetType === "CodeSummary" && showSummary)
                    );
                    
                    return sourceVisible && targetVisible ? null : "none";
                });
                
                // Filter link labels
                linkLabel.style("display", d => {
                    // Filter by relationship type
                    if (d.label === "DEFINES" && !showDefines) return "none";
                    if (d.label === "PART_OF" && !showPartOf) return "none";
                    if ((d.label === "DESCRIBES" || d.label === "SUMMARIZES") && !showDescribes) return "none";
                    
                    // Filter by node visibility (same as for links)
                    const sourceType = d.source.type;
                    const targetType = d.target.type;
                    
                    const sourceVisible = (
                        (sourceType === "File" && showFile) ||
                        (sourceType === "Function" && showFunction) ||
                        (sourceType === "Class" && showClass) ||
                        (sourceType === "Method" && showMethod) ||
                        (sourceType === "CodeSummary" && showSummary)
                    );
                    
                    const targetVisible = (
                        (targetType === "File" && showFile) ||
                        (targetType === "Function" && showFunction) ||
                        (targetType === "Class" && showClass) ||
                        (targetType === "Method" && showMethod) ||
                        (targetType === "CodeSummary" && showSummary)
                    );
                    
                    return sourceVisible && targetVisible ? null : "none";
                });
            }
            
            // Add zoom functionality
            const zoom = d3.zoom()
                .scaleExtent([0.1, 10])
                .on("zoom", zoomed);
            
            svg.call(zoom);
            
            function zoomed(event) {
                container.attr("transform", event.transform);
                
                // Show node labels only when zoomed in sufficiently
                const currentScale = event.transform.k;
                nodeLabel.style("opacity", () => currentScale > 1.5 ? 0.8 : 0);
            }
            
            // Search functionality
            const searchInput = document.getElementById("search-input");
            const searchResults = document.getElementById("search-results");
            
            searchInput.addEventListener("input", performSearch);
            
            function performSearch() {
                const query = searchInput.value.toLowerCase();
                if (query.length < 2) {
                    searchResults.innerHTML = "";
                    return;
                }
                
                // Find matching nodes
                const matches = nodesData.filter(node => {
                    const label = (node.label || "").toLowerCase();
                    
                    // Check properties
                    let propertiesMatch = false;
                    if (node.properties) {
                        for (const [key, value] of Object.entries(node.properties)) {
                            if (value && String(value).toLowerCase().includes(query)) {
                                propertiesMatch = true;
                                break;
                            }
                        }
                    }
                    
                    return label.includes(query) || propertiesMatch;
                }).slice(0, 20); // Limit to 20 results
                
                // Display results
                searchResults.innerHTML = "";
                if (matches.length === 0) {
                    searchResults.innerHTML = "<div>No matches found</div>";
                } else {
                    matches.forEach(node => {
                        const result = document.createElement("div");
                        result.className = "search-result";
                        result.innerHTML = `<span class="color-dot" style="background-color: ${colorMap[node.type]};"></span> ${node.type}: ${node.label}`;
                        
                        result.addEventListener("click", () => {
                            // Center and highlight the node
                            const transform = d3.zoomIdentity
                                .translate(width/2 - node.x, height/2 - node.y)
                                .scale(2);
                                
                            svg.transition()
                                .duration(750)
                                .call(zoom.transform, transform);
                                
                            // Simulate click to show info
                            showNodeInfo({}, node);
                            
                            // Find the node element and trigger mouseover
                            node.forEach((n, i) => {
                                if (n.id === node.id) {
                                    handleMouseOver({}, n);
                                }
                            });
                        });
                        
                        searchResults.appendChild(result);
                    });
                }
            }
            
            // Buttons to adjust force layout
            document.getElementById("expand-graph").addEventListener("click", () => {
                simulation.force("charge").strength(-500);
                simulation.alpha(1).restart();
            });
            
            document.getElementById("collapse-graph").addEventListener("click", () => {
                simulation.force("charge").strength(-100);
                simulation.alpha(1).restart();
            });
        </script>
    </body>
    </html>
